import React from 'react'

export const BilingDetailItem = ({item}) => {
  return (
    <div>
      <img
        style={{ width: 40, height: 40 }}
        src={process.env.REACT_APP_API_URL + item.item.img[0]}
      />
      <p>{item.item.name}</p>
      <p>{item.count * item.item.price} грн</p>
    </div>
  );
}
